import React from "react";
import classes from './Post.module.css'

const Post = (props) => {
    return <div className={classes.item}>
        <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR2_TRfBLeLipIfU1Dk0ctEVM7i-p-vCBv5Og&usqp=CAU"
            alt="avatar"/>
        {props.message}
        <div cls>
            img
            <span>{props}</span>
        </div>
    </div>

}
export default Post;
